--
-- 테이블 구조 "api_call_logs"
--

CREATE TABLE "api_call_logs" (
  "log_id" bigint NOT NULL,
  "api_name" VARCHAR(50) NOT NULL COMMENT ON COLUMN API name (Alpha Vantage, FMP, Binance, etc.),
  "endpoint" VARCHAR(255) NOT NULL COMMENT ON COLUMN Called endpoint (including function name),
  "asset_ticker" VARCHAR(20) DEFAULT NULL COMMENT ON COLUMN Related asset ticker,
  "status_code" int DEFAULT NULL COMMENT ON COLUMN HTTP status code,
  "response_time_ms" int DEFAULT NULL COMMENT ON COLUMN Response time (milliseconds),
  "success" BOOLEAN DEFAULT '0' COMMENT ON COLUMN Success status,
  "error_message" TEXT COMMENT ON COLUMN Error message,
  "created_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

--
-- 테이블 구조 "app_configurations"
--

CREATE TABLE "app_configurations" (
  "config_id" int NOT NULL,
  "config_key" VARCHAR(100) NOT NULL COMMENT ON COLUMN Unique key for configuration item,
  "config_value" TEXT COMMENT ON COLUMN Configuration value,
  "data_type" VARCHAR(20) DEFAULT 'string' COMMENT ON COLUMN Data type (string, int, float, boolean, json),
  "description" TEXT COMMENT ON COLUMN Description of the configuration,
  "is_sensitive" BOOLEAN DEFAULT '0' COMMENT ON COLUMN Whether this is sensitive information (API keys, passwords),
  "is_active" BOOLEAN DEFAULT '1' COMMENT ON COLUMN Configuration activation status,
  "category" VARCHAR(50) DEFAULT 'general' COMMENT ON COLUMN Configuration category (api_keys, scheduler, onchain_metrics),
  "created_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "updated_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

