--
-- 테이블 구조 "crypto_data"
--

CREATE TABLE "crypto_data" (
  "id" int NOT NULL,
  "asset_id" int NOT NULL COMMENT ON COLUMN Reference ID in assets table,
  "symbol" VARCHAR(20) NOT NULL COMMENT ON COLUMN Cryptocurrency symbol (e.g., BTC, ETH),
  "name" VARCHAR(100) NOT NULL COMMENT ON COLUMN Cryptocurrency name,
  "market_cap" DECIMAL(30,2) DEFAULT NULL COMMENT ON COLUMN Market capitalization in USD,
  "circulating_supply" DECIMAL(30,10) DEFAULT NULL COMMENT ON COLUMN Circulating supply,
  "total_supply" DECIMAL(30,10) DEFAULT NULL COMMENT ON COLUMN Total supply,
  "max_supply" DECIMAL(30,10) DEFAULT NULL COMMENT ON COLUMN Maximum supply,
  "current_price" DECIMAL(24,10) DEFAULT NULL COMMENT ON COLUMN Current price in USD,
  "volume_24h" DECIMAL(30,10) DEFAULT NULL COMMENT ON COLUMN 24-hour trading volume,
  "percent_change_1h" DECIMAL(10,4) DEFAULT NULL COMMENT ON COLUMN 1-hour price change percentage,
  "percent_change_24h" DECIMAL(10,4) DEFAULT NULL COMMENT ON COLUMN 24-hour price change percentage,
  "percent_change_7d" DECIMAL(10,4) DEFAULT NULL COMMENT ON COLUMN 7-day price change percentage,
  "percent_change_30d" DECIMAL(10,4) DEFAULT NULL COMMENT ON COLUMN 30-day price change percentage,
  "cmc_rank" int DEFAULT NULL COMMENT ON COLUMN CoinMarketCap rank,
  "category" VARCHAR(50) DEFAULT NULL COMMENT ON COLUMN Cryptocurrency category,
  "description" TEXT COMMENT ON COLUMN Cryptocurrency description,
  "logo_url" VARCHAR(500) DEFAULT NULL COMMENT ON COLUMN Logo URL,
  "website_url" VARCHAR(500) DEFAULT NULL COMMENT ON COLUMN Website URL,
  "price" DECIMAL(24,10) DEFAULT NULL COMMENT ON COLUMN Current price (alternative field),
  "slug" VARCHAR(100) DEFAULT NULL COMMENT ON COLUMN CoinMarketCap slug,
  "date_added" date DEFAULT NULL COMMENT ON COLUMN Date added to CoinMarketCap,
  "platform" TEXT,
  "explorer" json DEFAULT NULL COMMENT ON COLUMN Blockchain explorer URLs,
  "source_code" json DEFAULT NULL COMMENT ON COLUMN Source code URLs,
  "tags" json DEFAULT NULL COMMENT ON COLUMN Cryptocurrency tags,
  "is_active" BOOLEAN DEFAULT '1' COMMENT ON COLUMN Active status,
  "last_updated" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "created_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

--
