  "nrpl_btc" DECIMAL(24,10) DEFAULT NULL COMMENT ON COLUMN Bitcoin NRPL (Net Realized Profit Loss),
  "aviv" DECIMAL(18,10) DEFAULT NULL COMMENT ON COLUMN Active Value to Investor Value,
