INSERT INTO "stock_profiles" ("profile_id", "asset_id", "company_name", "description", "sector", "industry", "country", "city", "address", "phone", "website", "ceo", "employees_count", "ipo_date", "logo_image_url", "updated_at", "state", "zip_code", "exchange", "exchange_full_name", "cik", "isin", "cusip") VALUES (1, 5, 'Microsoft Corporation', 'Microsoft Corporation develops, licenses, and supports software, services, devices, and solutions worldwide. The company operates in three segments: Productivity and Business Processes, Intelligent Cloud, and More Personal Computing. The Productivity and Business Processes segment offers Office, Exchange, SharePoint, Microsoft Teams, Office 365 Security and Compliance, Microsoft Viva, and Skype for Business; Skype, Outlook.com, OneDrive, and LinkedIn; and Dynamics 365, a set of cloud-based and on-premises business solutions for organizations and enterprise divisions. The Intelligent Cloud segment licenses SQL, Windows Servers, Visual Studio, System Center, and related Client Access Licenses; GitHub that provides a collaboration platform and code hosting service for developers; Nuance provides healthcare and enterprise AI solutions; and Azure, a cloud platform. It also offers enterprise support, Microsoft consulting, and nuance professional services to assist customers in developing, deploying, and managing Microsoft server and desktop solutions; and training and certification on Microsoft products. The More Personal Computing segment provides Windows original equipment manufacturer (OEM) licensing and other non-volume licensing of the Windows operating system; Windows Commercial, such as volume licensing of the Windows operating system, Windows cloud services, and other Windows commercial offerings; patent licensing; and Windows Internet of Things. It also offers Surface, PC accessories, PCs, tablets, gaming and entertainment consoles, and other devices; Gaming, including Xbox hardware, and Xbox content and services; video games and third-party video game royalties; and Search, including Bing and Microsoft advertising. The company sells its products through OEMs, distributors, and resellers; and directly through digital marketplaces, online stores, and retail stores. Microsoft Corporation was founded in 1975 and is headquartered in Redmond, Washington.', 'Technology', 'Software - Infrastructure', 'US', 'Redmond', 'One Microsoft Way', '425 882 8080', 'https://www.microsoft.com', 'Satya Nadella', 228000, '1986-03-13', 'https://images.financialmodelingprep.com/symbol/MSFT.png', '2025-09-12 04:40:43', 'WA', '98052-6399', 'NASDAQ Global Select', 'NASDAQ Global Select', '0000789019', 'US5949181045', '594918104'),
(2, 6, 'International Business Machines Corporation', 'International Business Machines Corporation provides integrated solutions and services worldwide. The company operates through four business segments: Software, Consulting, Infrastructure, and Financing. The Software segment offers hybrid cloud platform and software solutions, such as Red Hat, an enterprise open-source solutions; software for business automation, AIOps and management, integration, and application servers; data and artificial intelligence solutions; and security software and services for threat, data, and identity. This segment also provides transaction processing software that supports clients\' mission-critical and on-premise workloads in banking, airlines, and retail industries. The Consulting segment offers business transformation services, including strategy, business process design and operations, data and analytics, and system integration services; technology consulting services; and application and cloud platform services. The Infrastructure segment provides on-premises and cloud-based server and storage solutions for its clients\' mission-critical and regulated workloads; and support services and solutions for hybrid cloud infrastructure, as well as remanufacturing and remarketing services for used equipment. The Financing segment offers lease, installment payment, loan financing, and short-term working capital financing services. The company was formerly known as Computing-Tabulating-Recording Co. International Business Machines Corporation was incorporated in 1911 and is headquartered in Armonk, New York.', 'Technology', 'Information Technology Services', 'US', 'Armonk', 'One New Orchard Road', '914 499 1900', 'https://www.ibm.com', 'Arvind Krishna', 270300, '1915-09-24', 'https://images.financialmodelingprep.com/symbol/IBM.png', '2025-09-12 04:40:45', 'NY', '10504', 'New York Stock Exchange', 'New York Stock Exchange', '0000051143', 'US4592001014', '459200101'),
(3, 8, 'Apple Inc.', 'Apple Inc. designs, manufactures, and markets smartphones, personal computers, tablets, wearables, and accessories worldwide. The company offers iPhone, a line of smartphones; Mac, a line of personal computers; iPad, a line of multi-purpose tablets; and wearables, home, and accessories comprising AirPods, Apple TV, Apple Watch, Beats products, and HomePod. It also provides AppleCare support and cloud services; and operates various platforms, including the App Store that allow customers to discover and download applications and digital content, such as books, music, video, games, and podcasts, as well as advertising services include third-party licensing arrangements and its own advertising platforms. In addition, the company offers various subscription-based services, such as Apple Arcade, a game subscription service; Apple Fitness+, a personalized fitness service; Apple Music, which offers users a curated listening experience with on-demand radio stations; Apple News+, a subscription news and magazine service; Apple TV+, which offers exclusive original content; Apple Card, a co-branded credit card; and Apple Pay, a cashless payment service, as well as licenses its intellectual property. The company serves consumers, and small and mid-sized businesses; and the education, enterprise, and government markets. It distributes third-party applications for its products through the App Store. The company also sells its products through its retail and online stores, and direct sales force; and third-party cellular network carriers, wholesalers, retailers, and resellers. Apple Inc. was founded in 1976 and is headquartered in Cupertino, California.', 'Technology', 'Consumer Electronics', 'US', 'Cupertino', 'One Apple Park Way', '(408) 996-1010', 'https://www.apple.com', 'Timothy D. Cook', 164000, '1980-12-12', 'https://images.financialmodelingprep.com/symbol/AAPL.png', '2025-09-12 04:40:43', 'CA', '95014', 'NASDAQ Global Select', 'NASDAQ Global Select', '0000320193', 'US0378331005', '037833100'),
(4, 9, 'Amazon.com, Inc.', 'Amazon.com, Inc. engages in the retail sale of consumer products and subscriptions through online and physical stores in North America and internationally. The company operates through three segments: North America, International, and Amazon Web Services (AWS). Its products offered through its stores include merchandise and content purchased for resale; and products offered by third-party sellers The company also manufactures and sells electronic devices, including Kindle, Fire tablets, Fire TVs, Rings, Blink, eero, and Echo; and develops and produces media content. In addition, it offers programs that enable sellers to sell their products in its stores; and programs that allow authors, musicians, filmmakers, Twitch streamers, skill and app developers, and others to publish and sell content. Further, the company provides compute, storage, database, analytics, machine learning, and other services, as well as fulfillment, advertising, and digital content subscriptions. Additionally, it offers Amazon Prime, a membership program. The company serves consumers, sellers, developers, enterprises, content creators, and advertisers. Amazon.com, Inc. was incorporated in 1994 and is headquartered in Seattle, Washington.', 'Consumer Cyclical', 'Specialty Retail', 'US', 'Seattle', '410 Terry Avenue North', '206 266 1000', 'https://www.amazon.com', 'Andrew R. Jassy', 1560000, '1997-05-15', 'https://images.financialmodelingprep.com/symbol/AMZN.png', '2025-09-12 04:40:43', 'WA', '98109-5210', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001018724', 'US0231351067', '023135106'),
(5, 10, 'Alphabet Inc.', 'Alphabet Inc. offers various products and platforms in the United States, Europe, the Middle East, Africa, the Asia-Pacific, Canada, and Latin America. It operates through Google Services, Google Cloud, and Other Bets segments. The Google Services segment provides products and services, including ads, Android, Chrome, devices, Gmail, Google Drive, Google Maps, Google Photos, Google Play, Search, and YouTube. It is also involved in the sale of apps and in-app purchases and digital content in the Google Play and YouTube; and devices, as well as in the provision of YouTube consumer subscription services. The Google Cloud segment offers infrastructure, cybersecurity, databases, analytics, AI, and other services; Google Workspace that include cloud-based communication and collaboration tools for enterprises, such as Gmail, Docs, Drive, Calendar, and Meet; and other services for enterprise customers. The Other Bets segment sells healthcare-related and internet services. The company was incorporated in 1998 and is headquartered in Mountain View, California.', 'Communication Services', 'Internet Content & Information', 'US', 'Mountain View', '1600 Amphitheatre Parkway', '650 253 0000', 'https://abc.xyz', 'Sundar Pichai', 185719, '2004-08-19', 'https://images.financialmodelingprep.com/symbol/GOOG.png', '2025-09-12 04:40:44', 'CA', '94043', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001652044', 'US02079K1079', '02079K107'),
(6, 11, 'Meta Platforms, Inc.', 'Meta Platforms, Inc. engages in the development of products that enable people to connect and share with friends and family through mobile devices, personal computers, virtual reality headsets, and wearables worldwide. It operates in two segments, Family of Apps and Reality Labs. The Family of Apps segment offers Facebook, which enables people to share, discuss, discover, and connect with interests; Instagram, a community for sharing photos, videos, and private messages, as well as feed, stories, reels, video, live, and shops; Messenger, a messaging application for people to connect with friends, family, communities, and businesses across platforms and devices through text, audio, and video calls; and WhatsApp, a messaging application that is used by people and businesses to communicate and transact privately. The Reality Labs segment provides augmented and virtual reality related products comprising consumer hardware, software, and content that help people feel connected, anytime, and anywhere. The company was formerly known as Facebook, Inc. and changed its name to Meta Platforms, Inc. in October 2021. Meta Platforms, Inc. was incorporated in 2004 and is headquartered in Menlo Park, California.', 'Communication Services', 'Internet Content & Information', 'US', 'Menlo Park', '1601 Willow Road', '650 543 4800', 'https://investor.fb.com', 'Mark Elliot Zuckerberg', 76834, '2012-05-18', 'https://images.financialmodelingprep.com/symbol/META.png', '2025-09-12 04:40:43', 'CA', '94025', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001326801', 'US30303M1027', '30303M102'),
(7, 12, 'Saudi Arabian Oil Company', 'Saudi Arabian Oil Company operates as an integrated oil and gas company in the Kingdom of Saudi Arabia and internationally. The company operates through two segments, Upstream and Downstream. The Upstream segment explores, develops, produces, and sells crude oil, condensate, natural gas, and natural gas liquids (NGLs). As of December 31, 2021, its reserves included 253.6 billion barrels of oil equivalent, including 196.9 billion barrels of crude oil and condensate; 25.2 billion barrels of NGLs; and 194.5 trillion standard cubic feet of natural gas, as well as 530 reservoirs within 137 fields distributed throughout the Kingdom and its territorial waters. The Downstream segment produces various chemicals, including olefins, methanol, MTBE, aromatics, glycols, linear alpha olefins, polyethylene, polypropylene, polyethylene terephthalate, polyvinyl chloride, polystyrene, polycarbonate, and engineering thermoplastics and their blends; and base oils, as well as in the refining and retail operations. It also supplies oil products; and trades in refined petroleum and liquid chemical products, and polymers. In addition, the company develops, manufactures, and markets high-performance rubber; and provides crude oil storage, investment, consulting, oil field, insurance, marketing and sales support, financing, and marine management and transportation services. Saudi Arabian Oil Company was founded in 1933 and is headquartered in Dhahran, the Kingdom of Saudi Arabia.', 'Energy', 'Oil & Gas Integrated', 'SA', 'Dhahran', 'PO Box 5000', '966 13 872 0115', 'https://www.aramco.com', 'Amin H. Nasser', 67947, '2019-12-11', 'https://images.financialmodelingprep.com/symbol/2222.SR.png', '2025-09-12 04:40:44', 'Eastern Province', '31311', 'Saudi Exchange', 'Saudi Exchange', NULL, 'SA14TG012N13', NULL),
(8, 14, 'Taiwan Semiconductor Manufacturing Company Limited', 'Taiwan Semiconductor Manufacturing Company Limited, together with its subsidiaries, manufactures, packages, tests, and sells integrated circuits and other semiconductor devices in Taiwan, China, Europe, the Middle East, Africa, Japan, the United States, and internationally. It provides a range of wafer fabrication processes, including processes to manufacture complementary metal- oxide-semiconductor (CMOS) logic, mixed-signal, radio frequency, embedded memory, bipolar CMOS mixed-signal, and others. The company also offers customer and engineering support services; manufactures masks; and invests in technology start-up companies; researches, designs, develops, manufactures, packages, tests, and sells color filters; and provides investment services. Its products are used in high performance computing, smartphones, Internet of things, automotive, and digital consumer electronics. The company was incorporated in 1987 and is headquartered in Hsinchu City, Taiwan.', 'Technology', 'Semiconductors', 'TW', 'Hsinchu City', 'Hsinchu Science Park', '886 3 563 6688', 'https://www.tsmc.com', 'C. C. Wei', 65152, '1997-10-09', 'https://images.financialmodelingprep.com/symbol/TSM.png', '2025-09-12 04:40:45', NULL, '300096', 'New York Stock Exchange', 'New York Stock Exchange', '0001046179', 'US8740391003', '874039100'),
(9, 13, 'Broadcom Inc.', 'Broadcom Inc. designs, develops, and supplies various semiconductor devices with a focus on complex digital and mixed signal complementary metal oxide semiconductor based devices and analog III-V based products worldwide. The company operates in two segments, Semiconductor Solutions and Infrastructure Software. It provides set-top box system-on-chips (SoCs); cable, digital subscriber line, and passive optical networking central office/consumer premise equipment SoCs; wireless local area network access point SoCs; Ethernet switching and routing merchant silicon products; embedded processors and controllers; serializer/deserializer application specific integrated circuits; optical and copper, and physical layers; and fiber optic transmitter and receiver components. The company also offers RF front end modules, filters, and power amplifiers; Wi-Fi, Bluetooth, and global positioning system/global navigation satellite system SoCs; custom touch controllers; serial attached small computer system interface, and redundant array of independent disks controllers and adapters; peripheral component interconnect express switches; fiber channel host bus adapters; read channel based SoCs; custom flash controllers; preamplifiers; and optocouplers, industrial fiber optics, and motion control encoders and subsystems. Its products are used in various applications, including enterprise and data center networking, home connectivity, set-top boxes, broadband access, telecommunication equipment, smartphones and base stations, data center servers and storage systems, factory automation, power generation and alternative energy systems, and electronic displays. Broadcom Inc. was incorporated in 2018 and is headquartered in San Jose, California.', 'Technology', 'Semiconductors', 'US', 'Palo Alto', '1320 Ridder Park Drive', '408 433 8000', 'https://www.broadcom.com', 'Hock E. Tan', 37000, '2009-08-06', 'https://images.financialmodelingprep.com/symbol/AVGO.png', '2025-09-12 04:40:45', 'CA', '95131-2313', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001730168', 'US11135F1012', '11135F101'),
(10, 15, 'Berkshire Hathaway Inc.', 'Berkshire Hathaway Inc., through its subsidiaries, engages in the insurance, freight rail transportation, and utility businesses worldwide. The company provides property, casualty, life, accident, and health insurance and reinsurance; and operates railroad systems in North America. It also generates, transmits, stores, and distributes electricity from natural gas, coal, wind, solar, hydroelectric, nuclear, and geothermal sources; operates natural gas distribution and storage facilities, interstate pipelines, liquefied natural gas facilities, and compressor and meter stations; and holds interest in coal mining assets. In addition, the company manufactures boxed chocolates and other confectionery products; specialty chemicals, metal cutting tools, and components for aerospace and power generation applications; flooring products; insulation, roofing, and engineered products; building and engineered components; paints and coatings; and bricks and masonry products, as well as offers manufactured and site-built home construction, and related lending and financial services. Further, it provides recreational vehicles, apparel and footwear products, jewelry, and custom picture framing products, as well as alkaline batteries; castings, forgings, fasteners/fastener systems, aerostructures, and precision components; and cobalt, nickel, and titanium alloys. Additionally, the company distributes televisions and information; franchises and services quick service restaurants; distributes electronic components; and offers logistics services, grocery and foodservice distribution services, and professional aviation training and shared aircraft ownership programs. It also retails automobiles; furniture, bedding, and accessories; household appliances, electronics, and computers; jewelry, watches, crystal, china, stemware, flatware, gifts, and collectibles; kitchenware; and motorcycle clothing and equipment. The company was incorporated in 1998 and is headquartered in Omaha, Nebraska.', 'Financial Services', 'Insurance - Diversified', 'US', 'Omaha', '3555 Farnam Street', '402 346 1400', 'https://www.berkshirehathaway.com', 'Warren E. Buffett', 392400, '1996-05-09', 'https://images.financialmodelingprep.com/symbol/BRK-B.png', '2025-09-12 04:40:45', 'NE', '68131', 'New York Stock Exchange', 'New York Stock Exchange', '0001067983', 'US0846707026', '084670702'),
(11, 16, 'Tesla, Inc.', 'Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, and internationally. It operates in two segments, Automotive, and Energy Generation and Storage. The Automotive segment offers electric vehicles, as well as sells automotive regulatory credits; and non-warranty after-sales vehicle, used vehicles, retail merchandise, and vehicle insurance services. This segment also provides sedans and sport utility vehicles through direct and used vehicle sales, a network of Tesla Superchargers, and in-app upgrades; purchase financing and leasing services; services for electric vehicles through its company-owned service locations and Tesla mobile service technicians; and vehicle limited warranties and extended service plans. The Energy Generation and Storage segment engages in the design, manufacture, installation, sale, and leasing of solar energy generation and energy storage products, and related services to residential, commercial, and industrial customers and utilities through its website, stores, and galleries, as well as through a network of channel partners; and provision of service and repairs to its energy product customers, including under warranty, as well as various financing options to its solar customers. The company was formerly known as Tesla Motors, Inc. and changed its name to Tesla, Inc. in February 2017. Tesla, Inc. was incorporated in 2003 and is headquartered in Austin, Texas.', 'Consumer Cyclical', 'Auto - Manufacturers', 'US', 'Austin', '1 Tesla Road', '512 516 8177', 'https://www.tesla.com', 'Elon R. Musk', 125665, '2010-06-29', 'https://images.financialmodelingprep.com/symbol/TSLA.png', '2025-09-12 04:40:45', 'TX', '78725', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001318605', 'US88160R1014', '88160R101'),
(12, 17, 'Walmart Inc.', 'Walmart Inc. engages in the operation of retail, wholesale, other units, and eCommerce worldwide. The company operates through three segments: Walmart U.S., Walmart International, and Sam\'s Club. It operates supercenters, supermarkets, hypermarkets, warehouse clubs, cash and carry stores, and discount stores under Walmart and Walmart Neighborhood Market brands; membership-only warehouse clubs; ecommerce websites, such as walmart.com.mx, walmart.ca, flipkart.com, PhonePe and other sites; and mobile commerce applications. The company offers grocery and consumables, including dairy, meat, bakery, deli, produce, dry, chilled or frozen packaged foods, alcoholic and nonalcoholic beverages, floral, snack foods, candy, other grocery items, health and beauty aids, paper goods, laundry and home care, baby care, pet supplies, and other consumable items; fuel, tobacco and other categories. It is also involved in the provision of health and wellness products covering pharmacy, optical and hearing services, and over-the-counter drugs and other medical products; and home and apparel including home improvement, outdoor living, gardening, furniture, apparel, jewelry, tools and power equipment, housewares, toys, seasonal items, mattresses and tire and battery centers. In addition, the company offers consumer electronics and accessories, software, video games, office supplies, appliances, and third-party gift cards. Further, it operates digital payment platforms; and offers financial services and related products, including money transfers, bill payments, money orders, check cashing, prepaid access, co-branded credit cards, installment lending, and earned wage access. Additionally, the company markets lines of merchandise under private brands, including Allswell, Athletic Works, Equate, and Free Assembly. The company was formerly known as Wal-Mart Stores, Inc. and changed its name to Walmart Inc. in February 2018. Walmart Inc. was founded in 1945 and is based in Bentonville, Arkansas.', 'Consumer Defensive', 'Discount Stores', 'US', 'Bentonville', '702 South West 8th Street', '479 273 4000', 'https://corporate.walmart.com', 'C. Douglas McMillon', 2100000, '1972-08-25', 'https://images.financialmodelingprep.com/symbol/WMT.png', '2025-09-12 04:40:45', 'AR', '72716', 'New York Stock Exchange', 'New York Stock Exchange', '0000104169', 'US9311421039', '931142103'),
(13, 18, 'JPMorgan Chase & Co.', 'JPMorgan Chase & Co. operates as a financial services company worldwide. It operates through four segments: Consumer & Community Banking (CCB), Corporate & Investment Bank (CIB), Commercial Banking (CB), and Asset & Wealth Management (AWM). The CCB segment offers s deposit, investment and lending products, payments, and services to consumers; lending, deposit, and cash management and payment solutions to small businesses; mortgage origination and servicing activities; residential mortgages and home equity loans; and credit card, auto loan, and leasing services. The CIB segment provides investment banking products and services, including corporate strategy and structure advisory, and equity and debt markets capital-raising services, as well as loan origination and syndication; payments and cross-border financing; and cash and derivative instruments, risk management solutions, prime brokerage, and research. This segment also offers securities services, including custody, fund accounting and administration, and securities lending products for asset managers, insurance companies, and public and private investment funds. The CB segment provides financial solutions, including lending, payments, investment banking, and asset management to small business, large and midsized companies, local governments, and nonprofit clients; and commercial real estate banking services to investors, developers, and owners of multifamily, office, retail, industrial, and affordable housing properties. The AWM segment offers multi-asset investment management solutions in equities, fixed income, alternatives, and money market funds to institutional clients and retail investors; and retirement products and services, brokerage, custody, trusts and estates, loans, mortgages, deposits, and investment management products. The company also provides ATM, online and mobile, and telephone banking services. JPMorgan Chase & Co. was founded in 1799 and is headquartered in New York, New York.', 'Financial Services', 'Banks - Diversified', 'US', 'New York City', '383 Madison Avenue', '212 270 6000', 'https://www.jpmorganchase.com', 'James Dimon', 318477, '1980-03-17', 'https://images.financialmodelingprep.com/symbol/JPM.png', '2025-09-12 04:40:46', 'NY', '10179', 'New York Stock Exchange', 'New York Stock Exchange', '0000019617', 'US46625H1005', '46625H100'),
(14, 19, 'Eli Lilly and Company', 'Eli Lilly and Company discovers, develops, and markets human pharmaceuticals worldwide. It offers Basaglar, Humalog, Humalog Mix 75/25, Humalog U-100, Humalog U-200, Humalog Mix 50/50, insulin lispro, insulin lispro protamine, insulin lispro mix 75/25, Humulin, Humulin 70/30, Humulin N, Humulin R, and Humulin U-500 for diabetes; and Jardiance, Trajenta, and Trulicity for type 2 diabetes. The company provides Alimta for non-small cell lung cancer (NSCLC) and malignant pleural mesothelioma; Cyramza for metastatic gastric cancer, gastro-esophageal junction adenocarcinoma, metastatic NSCLC, metastatic colorectal cancer, and hepatocellular carcinoma; Erbitux for colorectal cancers, and various head and neck cancers; Retevmo for metastatic NSCLC, medullary thyroid cancer, and thyroid cancer; Tyvyt for relapsed or refractory classic Hodgkin\'s lymph and non-squamous NSCLC; and Verzenio for HR+, HER2- metastatic breast cancer, node positive, and early breast cancer. It offers Olumiant for rheumatoid arthritis; and Taltz for plaque psoriasis, psoriatic arthritis, ankylosing spondylitis, and non-radiographic axial spondylarthritis. The company offers Cymbalta for depressive disorder, diabetic peripheral neuropathic pain, generalized anxiety disorder, fibromyalgia, and chronic musculoskeletal pain; Emgality for migraine prevention and episodic cluster headache; and Zyprexa for schizophrenia, bipolar I disorder, and bipolar maintenance. Its Bamlanivimab and etesevimab, and Bebtelovimab for COVID-19; Cialis for erectile dysfunction and benign prostatic hyperplasia; and Forteo for osteoporosis. The company has collaborations with Incyte Corporation; Boehringer Ingelheim Pharmaceuticals, Inc.; AbCellera Biologics Inc.; Junshi Biosciences; Regor Therapeutics Group; Lycia Therapeutics, Inc.; Kumquat Biosciences Inc.; Entos Pharmaceuticals Inc.; and Foghorn Therapeutics Inc. Eli Lilly and Company was founded in 1876 and is headquartered in Indianapolis, Indiana.', 'Healthcare', 'Drug Manufacturers - General', 'US', 'Indianapolis', 'Lilly Corporate Center', '317 276 2000', 'https://www.lilly.com', 'David A. Ricks', 47000, '1972-06-01', 'https://images.financialmodelingprep.com/symbol/LLY.png', '2025-09-12 04:40:47', 'IN', '46285', 'New York Stock Exchange', 'New York Stock Exchange', '0000059478', 'US5324571083', '532457108'),
(15, 20, 'Visa Inc.', 'Visa Inc. operates as a payments technology company worldwide. The company facilitates digital payments among consumers, merchants, financial institutions, businesses, strategic partners, and government entities. It operates VisaNet, a transaction processing network that enables authorization, clearing, and settlement of payment transactions. In addition, the company offers card products, platforms, and value-added services. It provides its services under the Visa, Visa Electron, Interlink, VPAY, and PLUS brands. Visa Inc. has a strategic agreement with Ooredoo to provide an enhanced payment experience for Visa cardholders and Ooredoo customers in Qatar. Visa Inc. was founded in 1958 and is headquartered in San Francisco, California.', 'Financial Services', 'Financial - Credit Services', 'US', 'San Francisco', 'PO Box 8999', '650 432 3200', 'https://usa.visa.com', 'Ryan M. McInerney', 28800, '2008-03-19', 'https://images.financialmodelingprep.com/symbol/V.png', '2025-09-12 04:40:47', 'CA', '94128-8999', 'New York Stock Exchange', 'New York Stock Exchange', '0001403161', 'US92826C8394', '92826C839'),
(16, 21, 'Oracle Corporation', 'Oracle Corporation offers products and services that address enterprise information technology environments worldwide. Its Oracle cloud software as a service offering include various cloud software applications, including Oracle Fusion cloud enterprise resource planning (ERP), Oracle Fusion cloud enterprise performance management, Oracle Fusion cloud supply chain and manufacturing management, Oracle Fusion cloud human capital management, Oracle Advertising, and NetSuite applications suite, as well as Oracle Fusion Sales, Service, and Marketing. The company also offers cloud-based industry solutions for various industries; Oracle application licenses; and Oracle license support services. In addition, it provides cloud and license business\' infrastructure technologies, such as the Oracle Database, an enterprise database; Java, a software development language; and middleware, including development tools and others. The company\'s cloud and license business\' infrastructure technologies also comprise cloud-based compute, storage, and networking capabilities; and Oracle autonomous database, MySQL HeatWave, Internet-of-Things, digital assistant, and blockchain. Further, it provides hardware products and other hardware-related software offerings, including Oracle engineered systems, enterprise servers, storage solutions, industry-specific hardware, virtualization software, operating systems, management software, and related hardware services; and consulting and customer services. The company markets and sells its cloud, license, hardware, support, and services offerings directly to businesses in various industries, government agencies, and educational institutions, as well as through indirect channels. Oracle Corporation was founded in 1977 and is headquartered in Austin, Texas.', 'Technology', 'Software - Infrastructure', 'US', 'Austin', '2300 Oracle Way', '737 867 1000', 'https://www.oracle.com', 'Safra Ada Catz', 159000, '1986-03-12', 'https://images.financialmodelingprep.com/symbol/ORCL.png', '2025-09-12 04:40:47', 'TX', '78741', 'New York Stock Exchange', 'New York Stock Exchange', '0001341439', 'US68389X1054', '68389X105'),
(17, 22, 'Tencent Holdings Limited', 'Tencent Holdings Limited, an investment holding company, provides value-added services (VAS) and Online advertising services in Mainland China and internationally. The company operates through VAS, Online Advertising, FinTech and Business Services, and Others segments. It offers online games and social network services; FinTech and cloud services, and online advertising services. The company is also involved in the production, investment, and distribution of films and television programs for third parties, as well as copyrights licensing, merchandise sales, and other activities. n addition, it develops software; develops and operates online games; and provides information technology, information system integration, asset management, online literature, and online music entertainment services. Tencent Holdings Limited company was founded in 1998 and is headquartered in Shenzhen, the People\'s Republic of China.', 'Communication Services', 'Internet Content & Information', 'CN', 'Shenzhen', 'Tencent Binhai Towers', '86 75 5860 13388', 'https://www.tencent.com', 'Huateng Ma', 110558, '2010-01-05', 'https://images.financialmodelingprep.com/symbol/TCEHY.png', '2025-09-12 04:40:47', NULL, '518054', 'Other OTC', 'Other OTC', '0001293451', 'US88032Q1094', '88032Q109'),
(18, 23, 'Netflix, Inc.', 'Netflix, Inc. provides entertainment services. It offers TV series, documentaries, feature films, and mobile games across various genres and languages. The company provides members the ability to receive streaming content through a host of internet-connected devices, including TVs, digital video players, television set-top boxes, and mobile devices. It also provides DVDs-by-mail membership services in the United States. The company has approximately 222 million paid members in 190 countries. Netflix, Inc. was incorporated in 1997 and is headquartered in Los Gatos, California.', 'Communication Services', 'Entertainment', 'US', 'Los Gatos', '100 Winchester Circle', '408 540 3700', 'https://www.netflix.com', 'Theodore A. Sarandos', 14000, '2002-05-23', 'https://images.financialmodelingprep.com/symbol/NFLX.png', '2025-09-12 04:40:47', 'CA', '95032', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001065280', 'US64110L1061', '64110L106'),
(19, 24, 'Mastercard Incorporated', 'Mastercard Incorporated, a technology company, provides transaction processing and other payment-related products and services in the United States and internationally. It facilitates the processing of payment transactions, including authorization, clearing, and settlement, as well as delivers other payment-related products and services. The company offers integrated products and value-added services for account holders, merchants, financial institutions, businesses, governments, and other organizations, such as programs that enable issuers to provide consumers with credits to defer payments; prepaid programs and management services; commercial credit and debit payment products and solutions; and payment products and solutions that allow its customers to access funds in deposit and other accounts. It also provides value-added products and services comprising cyber and intelligence solutions for parties to transact, as well as proprietary insights, drawing on principled use of consumer, and merchant data services. In addition, the company offers analytics, test and learn, consulting, managed services, loyalty, processing, and payment gateway solutions for e-commerce merchants. Further, it provides open banking and digital identity platforms services. The company offers payment solutions and services under the MasterCard, Maestro, and Cirrus. Mastercard Incorporated was founded in 1966 and is headquartered in Purchase, New York.', 'Financial Services', 'Financial - Credit Services', 'US', 'Purchase', '2000 Purchase Street', '914 249 2000', 'https://www.mastercard.com', 'Michael Miebach', 35300, '2006-05-25', 'https://images.financialmodelingprep.com/symbol/MA.png', '2025-09-12 04:40:48', 'NY', '10577', 'New York Stock Exchange', 'New York Stock Exchange', '0001141391', 'US57636Q1040', '57636Q104'),
(20, 25, 'XOM', 'Exxon Mobil Corporation explores for and produces crude oil and natural gas in the United States and internationally. It operates through Upstream, Downstream, and Chemical segments. The company is also involved in the manufacture, trade, transport, and sale of crude oil, natural gas, petroleum products, petrochemicals, and other specialty products; manufactures and sells petrochemicals, including olefins, polyolefins, aromatics, and various other petrochemicals; and captures and stores carbon, hydrogen, and biofuels. As of December 31, 2021, it had approximately 20,528 net operated wells with proved reserves. The company was founded in 1870 and is headquartered in Irving, Texas.', 'Energy', 'Oil & Gas Integrated', 'US', 'Irving', '5959 Las Colinas Boulevard', '972-940-6000', 'https://corporate.exxonmobil.com', 'Darren W. Woods', 61000, '1978-01-13', 'https://images.financialmodelingprep.com/symbol/XOM.png', '2025-08-28 02:17:27', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(21, 27, 'GOOGL', 'Alphabet Inc. provides various products and platforms in the United States, Europe, the Middle East, Africa, the Asia-Pacific, Canada, and Latin America. It operates through Google Services, Google Cloud, and Other Bets segments. The Google Services segment offers products and services, including ads, Android, Chrome, hardware, Gmail, Google Drive, Google Maps, Google Photos, Google Play, Search, and YouTube. It is also involved in the sale of apps and in-app purchases and digital content in the Google Play store; and Fitbit wearable devices, Google Nest home products, Pixel phones, and other devices, as well as in the provision of YouTube non-advertising services. The Google Cloud segment offers infrastructure, platform, and other services; Google Workspace that include cloud-based collaboration tools for enterprises, such as Gmail, Docs, Drive, Calendar, and Meet; and other services for enterprise customers. The Other Bets segment sells health technology and internet services. The company was founded in 1998 and is headquartered in Mountain View, California.', 'Communication Services', 'Internet Content & Information', 'US', 'Mountain View', '1600 Amphitheatre Parkway', '650 253 0000', 'https://www.abc.xyz', 'Sundar Pichai', 185719, '2004-08-19', 'https://images.financialmodelingprep.com/symbol/GOOGL.png', '2025-08-28 02:17:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(22, 28, 'ADBE', 'Adobe Inc. operates as a diversified software company worldwide. It operates through three segments: Digital Media, Digital Experience, and Publishing and Advertising. The Digital Media segment offers products, services, and solutions that enable individuals, teams, and enterprises to create, publish, and promote content; and Document Cloud, a unified cloud-based document services platform. Its flagship product is Creative Cloud, a subscription service that allows members to access its creative products. This segment serves content creators, workers, marketers, educators, enthusiasts, communicators, and consumers. The Digital Experience segment provides an integrated platform and set of applications and services that enable brands and businesses to create, manage, execute, measure, monetize, and optimize customer experiences from analytics to commerce. This segment serves marketers, advertisers, agencies, publishers, merchandisers, merchants, web analysts, data scientists, developers, and executives across the C-suite. The Publishing and Advertising segment offers products and services, such as e-learning solutions, technical document publishing, web conferencing, document and forms platform, web application development, and high-end printing, as well as Advertising Cloud offerings. The company offers its products and services directly to enterprise customers through its sales force and local field offices, as well as to end users through app stores and through its website at adobe.com. It also distributes products and services through a network of distributors, value-added resellers, systems integrators, software vendors and developers, retailers, and original equipment manufacturers. The company was formerly known as Adobe Systems Incorporated and changed its name to Adobe Inc. in October 2018. Adobe Inc. was founded in 1982 and is headquartered in San Jose, California.', 'Technology', 'Software - Infrastructure', 'US', 'San Jose', '345 Park Avenue', '408 536 6000', 'https://www.adobe.com', 'Shantanu Narayen', 30709, '1986-08-13', 'https://images.financialmodelingprep.com/symbol/ADBE.png', '2025-08-28 02:17:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(23, 29, 'AMAT', 'Applied Materials, Inc. provides manufacturing equipment, services, and software to the semiconductor, display, and related industries. It operates through three segments: Semiconductor Systems, Applied Global Services, and Display and Adjacent Markets. The Semiconductor Systems segment develops, manufactures, and sells various manufacturing equipment that is used to fabricate semiconductor chips or integrated circuits. This segment also offers various technologies, including epitaxy, ion implantation, oxidation/nitridation, rapid thermal processing, physical vapor deposition, chemical vapor deposition, chemical mechanical planarization, electrochemical deposition, atomic layer deposition, etching, and selective deposition and removal, as well as metrology and inspection tools. The Applied Global Services segment provides integrated solutions to optimize equipment and fab performance and productivity comprising spares, upgrades, services, remanufactured earlier generation equipment, and factory automation software for semiconductor, display, and other products. The Display and Adjacent Markets segment offers products for manufacturing liquid crystal displays; organic light-emitting diodes; and other display technologies for TVs, monitors, laptops, personal computers, electronic tablets, smart phones, and other consumer-oriented devices. The company operates in the United States, China, Korea, Taiwan, Japan, Southeast Asia, and Europe. Applied Materials, Inc. was incorporated in 1967 and is headquartered in Santa Clara, California.', 'Technology', 'Semiconductors', 'US', 'Santa Clara', '3050 Bowers Avenue', '408 727 5555', 'https://www.appliedmaterials.com', 'Gary E. Dickerson', 36000, '1980-03-17', 'https://images.financialmodelingprep.com/symbol/AMAT.png', '2025-08-28 02:17:28', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(24, 30, 'CSCO', 'Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. The company also offers switching portfolio encompasses campus switching as well as data center switching; enterprise routing portfolio interconnects public and private wireline and mobile networks, delivering highly secure, and reliable connectivity to campus, data center and branch networks; and wireless products include indoor and outdoor wireless coverage designed for seamless roaming use of voice, video, and data applications. In addition, it provides security, which comprising network security, identity and access management, secure access service edge, and threat intelligence, detection, and response offerings; collaboration products, such as Webex Suite, collaboration devices, contact center, and communication platform as a service; end-to-end collaboration solutions that can be delivered from the cloud, on-premise or within hybrid cloud environments allowing customers to transition their collaboration solutions from on-premise to the cloud; and observability offers network assurance, monitoring and analytics and observability suite. Further, the company offers a range of service and support options for its customers, including technical support and advanced services and advisory services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.', 'Technology', 'Communication Equipment', 'US', 'San Jose', '170 West Tasman Drive', '(408) 526-4000', 'https://www.cisco.com', 'Charles H. Robbins', 90400, '1990-02-16', 'https://images.financialmodelingprep.com/symbol/CSCO.png', '2025-08-28 02:17:29', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(25, 31, 'FAST', 'Fastenal Company, together with its subsidiaries, engages in the wholesale distribution of industrial and construction supplies in the United States, Canada, Mexico, North America, and internationally. It offers fasteners, and related industrial and construction supplies under the Fastenal name. The company\'s fastener products include threaded fasteners, bolts, nuts, screws, studs, and related washers, which are used in manufactured products and construction projects, as well as in the maintenance and repair of machines. It also offers miscellaneous supplies and hardware, including pins, machinery keys, concrete anchors, metal framing systems, wire ropes, strut products, rivets, and related accessories. The company serves the manufacturing market comprising original equipment manufacturers; maintenance, repair, and operations; and non-residential construction market, which includes general, electrical, plumbing, sheet metal, and road contractors. It also serves farmers, truckers, railroads, mining companies, schools, and retail trades; and oil exploration, production, and refinement companies, as well as federal, state, and local governmental entities. The company distributes its products through a network of 3,209 in-market locations and 15 distribution centers. Fastenal Company was founded in 1967 and is headquartered in Winona, Minnesota.', 'Industrials', 'Industrial - Distribution', 'US', 'Winona', '2001 Theurer Boulevard', '507 454 5374', 'https://www.fastenal.com', 'Daniel L. Florness', 21339, '1987-08-20', 'https://images.financialmodelingprep.com/symbol/FAST.png', '2025-08-28 02:17:29', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 7, 'NVIDIA Corporation', 'NVIDIA Corporation provides graphics, and compute and networking solutions in the United States, Taiwan, China, and internationally. The company\'s Graphics segment offers GeForce GPUs for gaming and PCs, the GeForce NOW game streaming service and related infrastructure, and solutions for gaming platforms; Quadro/NVIDIA RTX GPUs for enterprise workstation graphics; vGPU software for cloud-based visual and virtual computing; automotive platforms for infotainment systems; and Omniverse software for building 3D designs and virtual worlds. Its Compute & Networking segment provides Data Center platforms and systems for AI, HPC, and accelerated computing; Mellanox networking and interconnect solutions; automotive AI Cockpit, autonomous driving development agreements, and autonomous vehicle solutions; cryptocurrency mining processors; Jetson for robotics and other embedded platforms; and NVIDIA AI Enterprise and other software. The company\'s products are used in gaming, professional visualization, datacenter, and automotive markets. NVIDIA Corporation sells its products to original equipment manufacturers, original device manufacturers, system builders, add-in board manufacturers, retailers/distributors, independent software vendors, Internet and cloud service providers, automotive manufacturers and tier-1 automotive suppliers, mapping companies, start-ups, and other ecosystem participants. It has a strategic collaboration with Kroger Co. NVIDIA Corporation was incorporated in 1993 and is headquartered in Santa Clara, California.', 'Technology', 'Semiconductors', 'US', 'Santa Clara', '2788 San Tomas Expressway', '408 486 2000', 'https://www.nvidia.com', 'Jen-Hsun Huang', 36000, '1999-01-22', 'https://images.financialmodelingprep.com/symbol/NVDA.png', '2025-09-12 04:40:43', 'CA', '95051', 'NASDAQ Global Select', 'NASDAQ Global Select', '0001045810', 'US67066G1040', '67066G104'),

