CREATE TABLE "technical_indicators" (
  "indicator_data_id" bigint NOT NULL,
  "asset_id" int NOT NULL COMMENT ON COLUMN Reference ID in assets table,
  "data_interval" VARCHAR(10) NOT NULL DEFAULT '1d' COMMENT ON COLUMN Data interval (e.g., 1m, 5m, 1h, 1d, 1w, 1M),
  "indicator_type" VARCHAR(50) NOT NULL COMMENT ON COLUMN Indicator type (e.g., SMA, EMA, RSI, MACD),
  "indicator_period" int DEFAULT NULL COMMENT ON COLUMN Indicator period (e.g., 20-day SMA),
  "timestamp_utc" TIMESTAMP NOT NULL COMMENT ON COLUMN Timestamp for indicator calculation,
  "value" DECIMAL(24,10) NOT NULL,
  "value_2" DECIMAL(24,10) DEFAULT NULL,
  "value_3" DECIMAL(24,10) DEFAULT NULL,
  "created_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  "updated_at" TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

