--
-- 테이블 구조 "websocket_orchestrator_logs"
--

CREATE TABLE "websocket_orchestrator_logs" (
  "id" bigint NOT NULL,
  "timestamp_utc" timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  "log_level" enum('DEBUG','INFO','WARNING','ERROR','CRITICAL') COLLATE utf8mb4_unicode_ci NOT NULL,
  "consumer_name" varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  "event_type" varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  "message" text COLLATE utf8mb4_unicode_ci NOT NULL,
  "ticker_count" int DEFAULT NULL,
  "consumer_count" int DEFAULT NULL,
  "error_type" varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  "metadata" json DEFAULT NULL,
  "created_at" timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  "updated_at" timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);

