  "country" VARCHAR(100) DEFAULT NULL,
  "ranking_date" date NOT NULL DEFAULT (curdate()),
  "data_source" VARCHAR(100) DEFAULT NULL,
  "last_updated" timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);

